import React from "react";
import ReactDOM from "react-dom";
import pi, { dPi, tPi } from "./math";
// import * as pi from "./math";
import {a,s,m,d} from "./calculator"
const rootElement = document.getElementById("root");
ReactDOM.render(
  <div>
    <h1>Pi number</h1>
    <ui>
      <li>{pi}</li>
      <li>{dPi()}</li>
      <li>{tPi()}</li>
    </ui>
     <h1> 71 and 19 </h1>
    <ui>
      <li>{a(71,19)}</li>
      <li>{s(71,19)}</li>
      <li>{m(71,19)}</li>
      <li>{d(71,19)}</li>

    </ui>
  </div>,
  rootElement
);
